public void a05_default() {
	Items t = new Items();

	t._default("foo");
	assertObject(t._default()).is("foo");

	t._default(new StringBuilder("foo"));
	assertObject(t._default()).isType(StringBuilder.class).asString().is("foo");

	t._default(null);
	assertObject(t._default()).isNull();
}

